Here's a shorter way. I know it's actually longer, but it includes a bunch of solid handlers. The function itself is written in 4 lines (including brackets):

```
#include <iostream>
#include <list>
#include <string>

using namespace std;

string getDayOfWeek(int dayNum) {
    string Week[7] = {"Sunday", "Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday"};
    if (dayNum <= 7) {
        return Week[dayNum-1];
    } else {
        return to_string(dayNum);
    }
}

int main() {
    string uInput;
    string result;
    int dayNum;

    cout << "Enter a number of a day: ";
    cin >> uInput;

    try {
        int dayNum = stoi(uInput);
    } catch (exception& ex) {
        cout << "Invalid value: " << uInput << endl;
        return 2;
    }
    dayNum = stoi(uInput);

    result = getDayOfWeek(dayNum);

    try {
        if (result != "") {
            int x = stoi(result);
            cout << "Invalid number: " << x << endl;
            return 1;
        } else {
            int x = stoi(result);
            cout << "Invalid number: " << x << endl;
            return 3;
        }
    } catch (exception& ex) {
        cout << "The corresponding day of the week is " << result << endl;
    }

    return 0;
}
```

