var gulp = require('gulp');
var sass = require('gulp-sass');
var uglifycss = require('gulp-uglifycss');
var clean = require('gulp-clean');

sass.compiler = require('node-sass');

gulp.task('sass', function () {
  return gulp.src('./sass/*.scss')
    .pipe(sass().on('error', sass.logError))
    .pipe(gulp.dest('./css'));
});

gulp.task('css', function () {
 return gulp.src('./css/*.css')
    .pipe(uglifycss({
      "maxLineLen": 80,
      "uglyComments": true
    }))
    .pipe(gulp.dest('./dist/'));
});

gulp.task('clean', function () {
    return gulp.src('dist', {read: false})
        .pipe(clean());
});


 gulp.task('run', gulp.series('sass','css'));
 gulp.task('watch', function(){
 gulp.watch('./sass/*.scss', gulp.series('sass'));
  gulp.watch('./css/*.css', gulp.series('css'));
 });
 gulp.task('default',gulp.series('watch'));



/*'P.S. If you will run command "gulp" command in your terminal or cmd, gulpfile will run few tasks : 
1) "sass" - will compile your sass code into css code
2) "css'" - will compile your css code to dist folder,  these commands will be re-runs till you push "Ctrl+C" in your terminal, thanks to "watch" command*/

const gulp = require('gulp');
const sass = require('gulp-sass');
const uglifycss = require('gulp-uglifycss');

// Compile Sass
gulp.task('sass', function(){
  return gulp.src('./assets/sass/*.sass')
    .pipe(sass().on('error', sass.logError))
    .pipe(gulp.dest('./compiled/css'));
});

// Compile Minify CSS
gulp.task('css', function(){
  return gulp.src('./compiled/css/*.css')
    .pipe(uglifycss({
      'maxLineLen' : 400,
      'uglyComments' : true
    }))
    .pipe(gulp.dest('./dist/css/'));
});

// Run Sass and CSS functions
gulp.task('run', gulp.series('sass', 'css'));

// Watch for changes in Sass
gulp.task('watch', function(){
  gulp.watch('./assets/sass/*.sass', gulp.series('sass'));
  gulp.watch('./compiled/css/*.css', gulp.series('css'));
});

// Default task ran when 'gulp' is called
gulp.task('default', gulp.series('run', 'watch'));


